import React from 'react';
import { Card, CardContent, Typography, Box } from '@mui/material';

const ResultsComponent = ({ results }) => {
  if (!results) return null;

  const { data, meta } = results;

  // Extraer información relevante
  const date = data?.attributes?.date;
  const lastAnalysisStats = data?.attributes?.last_analysis_stats;
  const totalVotes = data?.attributes?.total_votes;

  return (
    <Box sx={{ mt: 4 }}>
      <Card>
        <CardContent>
          <Typography variant="h5" component="h2">
            Analysis Results
          </Typography>
          {date && (
            <Typography variant="body1" component="p" sx={{ mt: 2 }}>
              Report Date: {new Date(date * 1000).toLocaleString()}
            </Typography>
          )}
          {lastAnalysisStats && (
            <Box sx={{ mt: 2 }}>
              <Typography variant="h6" component="h3">
                Analysis Stats:
              </Typography>
              <Typography variant="body2" component="p">
                Harmless: {lastAnalysisStats.harmless ?? 'N/A'}
              </Typography>
              <Typography variant="body2" component="p">
                Malicious: {lastAnalysisStats.malicious ?? 'N/A'}
              </Typography>
              <Typography variant="body2" component="p">
                Suspicious: {lastAnalysisStats.suspicious ?? 'N/A'}
              </Typography>
              <Typography variant="body2" component="p">
                Undetected: {lastAnalysisStats.undetected ?? 'N/A'}
              </Typography>
            </Box>
          )}
          {totalVotes && (
            <Box sx={{ mt: 2 }}>
              <Typography variant="h6" component="h3">
                Total Votes:
              </Typography>
              <Typography variant="body2" component="p">
                Harmless: {totalVotes.harmful ?? 'N/A'}
              </Typography>
              <Typography variant="body2" component="p">
                Malicious: {totalVotes.malicious ?? 'N/A'}
              </Typography>
            </Box>
          )}
          <Typography variant="body2" component="pre" sx={{ mt: 2 }}>
            {JSON.stringify(meta, null, 2)}
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
};

export default ResultsComponent;
